import 'bootstrap/dist/css/bootstrap.min.css';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import React, {Component} from "react";
import LoginIcon from '@material-ui/icons/AlternateEmail';
import PasswordIcon from '@material-ui/icons/VpnKey'
import './login.css'

class Login extends Component {
    render() {
        return (
            <Container>
                <Form>
                    <span class="inline">
                    <LoginIcon color="secondary" fontSize="large" display="inline-block"></LoginIcon>
                    <Form.Group class="mar" controlId="form.Email">
                        <Form.Control type="email" placeholder="이메일" />
                    </Form.Group>
                    </span>
                    <span class="inline">
                    <PasswordIcon color="secondary" fontSize="large"></PasswordIcon>
                    <Form.Group controlId="form.Password">
                        <Form.Control type="password" placeholder="비밀번호" />
                    </Form.Group>
                    </span>
                    <Button variant="success" onClick={'www.naver.com'}>Login</Button>
                </Form>
            </Container>
        );
    }
}

export default Login;
